    - ID: "30b0a514-dc94-432c-9655-8c01e474023f"
      Hint: ExtendedContent
      Value: "<p>Duplex™-G larvicide delivers dual-active control through a combination of biorational control agent (S)-methoprene and biological control agent <em>Bacillus thuringiensis </em>subspecies<em> israelensis (Bti)</em> in a granular formulation. </p> <h4>FEATURES:</h4> <ul> <li>Provides a quick kill with long residual control of most mosquito larvae species</li> <li>Allows for pre-flood treatments with “Active Booster Release Technology”</li> <li>Features a high bulk density allowing for excellent foliage penetration with no-drift applications</li> <li>Assists with resistance management</li> <li>Creates low-to-no impact on non-target species with (S)-methoprene core designed for environmental compatibility</li> <li>Ensures calibration ease and normalized swath characterization for ground and aerial application equipment with uniform granule size</li> <li>Offers wide application range; 2.5 – 20 lbs. per acre</li> </ul> <br />"
